import styled from 'styled-components'

const Navbar = styled.nav`
    height: 100px;
    border-bottom: 1px solid #000;
`

export default function Homepage() {
  return (
    <header class="header">
      <Navbar>
        <li><a href="/">Logo</a></li>
        <ul class="menu">
          <li><a href="/">produtos</a></li>
          <li><a href="/">sobre</a></li>
          <li><a href="/">contato</a></li>
        </ul>
      </Navbar>
    </header>
  )
}
